INSERT INTO `abouts` (`id`, `title_en`, `title_ml`, `description_en`, `description_ml`, `main_image`, `reviews`, `awards`, `products`, `customers`, `image1`, `image2`, `image3`, `image4`, `created_at`, `updated_at`) VALUES
(1, 'We sell and service your dream motorcycles in Pathanamthitta', 'നിങ്ങളുടെ സ്വപ്ന മോട്ടോർസൈക്കിളുകൾ ഞങ്ങൾ പത്തനംതിട്ടയിൽ വിൽക്കുകയും സർവീസ് ചെയ്യുകയും ചെയ്യുന്നു', '<p class=\"MsoNormal\"><span lang=\"EN-US\">M/s. Toms Motors Pvt. Ltd registered as a Pvt.\r\nLtd Co. was incepted in Aug 2007 as the authorized Dealership of\r\nM/s. Suzuki Motorcycle India Pvt. Ltd., in Pathanamthitta.&nbsp; Now it has branches at Thiruvalla, Adoor, Ranny\r\n, Pullad, Konni, Malappally, Kalanjoor, and Pandalam.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\">Due to its centralized location, the\r\nDealership is easily accessible to customers in and around Pathanamthitta.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\">The Company deals with the Sales, Service, and\r\nSpare Parts of Suzuki Motorcycles. To date, about 35000 Bikes and\r\nScooters of different variants have been rolled out from the Dealership.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\">Online Booking and Door Step enquiry for\r\nServices is very much accepted by customers.&nbsp;&nbsp;<o:p></o:p></span></p>', '<div>മിസ്. ടോംസ് മോട്ടോഴ്സ് പ്രൈവറ്റ് ലിമിറ്റഡ്. ലിമിറ്റഡ് ഒരു പ്രൈവറ്റ് ലിമിറ്റഡ് ആയി രജിസ്റ്റർ ചെയ്തു. Ltd Co. 2007 ഓഗസ്റ്റിൽ M/s-ന്റെ അംഗീകൃത ഡീലർഷിപ്പായി ആരംഭിച്ചു. സുസുക്കി മോട്ടോർസൈക്കിൾ ഇന്ത്യ പ്രൈവറ്റ് ലിമിറ്റഡ്. ലിമിറ്റഡ്, പത്തനംതിട്ടയിൽ. ഇപ്പോൾ തിരുവല്ല, അടൂർ, റാന്നി, പുല്ലാട്, കോന്നി, മലപ്പള്ളി, കലഞ്ഞൂർ, പന്തളം എന്നിവിടങ്ങളിൽ ശാഖകളുണ്ട്.</div><div><br></div><div>കേന്ദ്രീകൃത സ്ഥാനം കാരണം, പത്തനംതിട്ടയിലും പരിസരത്തുമുള്ള ഉപഭോക്താക്കൾക്ക് ഡീലർഷിപ്പ് എളുപ്പത്തിൽ ആക്സസ് ചെയ്യാൻ കഴിയും.</div><div><br></div><div>സുസുക്കി മോട്ടോർസൈക്കിളുകളുടെ വിൽപ്പന, സേവനം, സ്പെയർ പാർട്സ് എന്നിവ കമ്പനി കൈകാര്യം ചെയ്യുന്നു. ഇന്നുവരെ, ഡീലർഷിപ്പിൽ നിന്ന് വ്യത്യസ്ത വേരിയന്റുകളിലായി ഏകദേശം 35000 ബൈക്കുകളും സ്‌കൂട്ടറുകളും</div>', '1725267305103138.jpg', 100, 96, 15, 35000, '1725267305196646.jpg', '1725267305817827.jpg', '1725267306375742.jpg', '1725267306933473.jpg', NULL, '2022-03-03 09:58:43');
