(2, 4, 'Presenting the upgraded Version of Access 125 with more appeal and features.', 'ആക്‌സസ് 125-ന്റെ അപ്‌ഗ്രേഡ് ചെയ്‌ത പതിപ്പ് കൂടുതൽ ആകർഷണീയതയോടും സവിശേഷതകളോടും കൂടി അവതരിപ്പിക്കുന്നു.', '1724928765511125.png', 'LED Headlamp,LED Position Lights,Side Stand Interlock,Premium Chrome External Fuel Lit,Bluetooth Enabled Digital Console,Engine Start and Kill Switch with Suzuki Easy Start System,Eco Assist Illumination,USB Socket,Front Rack for Storage,21.8L Under Seat Storage,Convenient Dual Luggage Hooks,One Push Central Lock System,Long Seat & Long Floor Board,Retro Seat,Voltage Meter', 'എൽഇഡി ഹെഡ്‌ലാമ്പ്, എൽഇഡി പൊസിഷൻ ലൈറ്റുകൾ, സൈഡ് സ്റ്റാൻഡ് ഇന്റർലോക്ക്, പ്രീമിയം ക്രോം എക്‌സ്‌റ്റേണൽ ഫ്യുവൽ ലിറ്റ്, ബ്ലൂടൂത്ത് പ്രവർത്തനക്ഷമമാക്കിയ ഡിജിറ്റൽ കൺസോൾ, സുസുക്കി ഈസി സ്റ്റാർട്ട് സിസ്റ്റം ഉപയോഗിച്ച് എഞ്ചിൻ സ്റ്റാർട്ട് ആന്റ് കിൽ സ്വിച്ച്, ഇക്കോ അസിസ്റ്റ് ഇല്യൂമിനേഷൻ, യുഎസ്ബി സോക്കറ്റ്, ഫ്രണ്ട് സെയ്‌21, സ്‌റ്റോറേജ് 8-ന് താഴെയുള്ള റാക്ക്. , സൗകര്യപ്രദമായ ഡ്യുവൽ ലഗേജ് ഹുക്കുകൾ, ഒരു പുഷ് സെൻട്രൽ ലോക്ക് സിസ്റ്റം, ലോംഗ് സീറ്റ് & ലോംഗ് ഫ്ലോർ ബോർഡ്, റെട്രോ സീറ്റ്, വോൾട്ടേജ് മീറ്റർ', 'Footrest,Meter Visor,Garnish Chrome Kit,Floor Mat,Seat Cover,Body Cover,Accessories Bar', 'ഫുട്‌റെസ്റ്റ്, മീറ്റർ വിസർ, ഗാർണിഷ് ക്രോം കിറ്റ്, ഫ്ലോർ മാറ്റ്, സീറ്റ് കവർ, ബോഡി കവർ, ആക്‌സസറീസ് ബാർ', 124, '4-Stroke, 1-Cyclinder, Air Cooled', '4-സ്ട്രോക്ക്, 1-സൈക്ലിണ്ടർ, എയർ കൂൾഡ്', 'Fuel Injection', 'ഫ്യൂവൽ ഇഞ്ചക്ഷൻ', 'SOHC, 2-Valve', 'SOHC, 2-വാൽവ്', '52.5 mm x 57.4 mm', '8.7 ps@6750 rpm', '10Nm@5500 rpm', 'Kick & Electrical', 'കിക്ക് & ഇലക്ട്രിക്കൽ', 'CVT', 'സി.വി.ടി', 'Alloy', 'അലോയ്', 1870, 690, 1160, 1265, 160, 773, 103, 5, 'Drum Brake', 'ഡ്രം ബ്രേക്ക്', 'Drum', 'ഡ്രം', '90/90-12-Tubeless', '9/100-10-Tubeless', 'Telescopic', 'ടെലിസ്കോപ്പിക്', 'Swing Arm', 'സ്വിംഗ് ആം', 'Maintenance–free 12V, 3Ah', 'മെയിന്റനൻസ്-ഫ്രീ 12V, 3Ah', 'LED', 'Incandescent', '20220216142449.pdf', 'https://www.youtube.com/embed/YA4Sza4OvmU', '2022-02-23 12:13:12', '2022-02-23 12:13:12'),
