(10, 11, 'Presenting the 2020 series of Gixxer SF with aggressive and sharp styling. Your most admired bike is now more sportier.', '2020-ലെ Gixxer SF സീരീസ് ആക്രമണാത്മകവും മൂർച്ചയുള്ളതുമായ സ്റ്റൈലിംഗോടെ അവതരിപ്പിക്കുന്നു. നിങ്ങളുടെ ഏറ്റവും പ്രിയപ്പെട്ട ബൈക്ക് ഇപ്പോൾ കൂടുതൽ സ്‌പോർട്ടിയർ ആണ്.', '1725369913194981.png', 'Aerodynamic Design, LED Head Lamp, LED Tail Lamp, Digital Instrumentation, Disc ABS, Twin Muffler, SEP Engine, Side Stand Interlock, Fuel Injection, Clip-On Handle Bar, Rear Tyre Hugger, Split Seat, Stiffer Front Suspension', 'എയറോഡൈനാമിക് ഡിസൈൻ, എൽഇഡി ഹെഡ് ലാമ്പ്, എൽഇഡി ടെയിൽ ലാമ്പ്, ഡിജിറ്റൽ ഇൻസ്ട്രുമെന്റേഷൻ, ഡിസ്ക് എബിഎസ്, ട്വിൻ മഫ്ലർ, എസ്ഇപി എഞ്ചിൻ, സൈഡ് സ്റ്റാൻഡ് ഇന്റർലോക്ക്, ഫ്യൂവൽ ഇഞ്ചക്ഷൻ, ക്ലിപ്പ്-ഓൺ ഹാൻഡിൽ ബാർ, റിയർ ടയർ ഹഗ്ഗർ, സ്പ്ലിറ്റ് സീറ്റ്, സ്റ്റിഫർ ഫ്രണ്ട് സസ്പെൻഷൻ', 'Saddle Bags, Cover Muffler Lower, DC Socket, Seat Cover, Tape Set Tank Blue, Tape Set Tank Pad Silver, Tape Set Knee Grip Pad, Tape Set Protection, Meter Visor', 'സാഡിൽ ബാഗുകൾ, കവർ മഫ്‌ളർ ലോവർ, ഡിസി സോക്കറ്റ്, സീറ്റ് കവർ, ടേപ്പ് സെറ്റ് ടാങ്ക് ബ്ലൂ, ടേപ്പ് സെറ്റ് ടാങ്ക് പാഡ് സിൽവർ, ടേപ്പ് സെറ്റ് മുട്ട് ഗ്രിപ്പ് പാഡ്, ടേപ്പ് സെറ്റ് പ്രൊട്ടക്ഷൻ, മീറ്റർ വിസർ', 153, '4-Stroke, 1-Cylinder, Air Cooled', '4-സ്ട്രോക്ക്, 1-സിലിണ്ടർ, എയർ കൂൾഡ്', 'Fuel Injection', 'ഫ്യൂവൽ ഇഞ്ചക്ഷൻ', 'SOHC, 2-Valve', 'SOHC, 2-വാൽവ്', '56.0 x 62.9 mm', '13.6 ps @ 8000 rpm', '13.8 Nm @ 6000 rpm', 'Electric', 'ഇലക്ട്രിക്കൽ', '5 Speed, MT', '5 സ്പീഡ്, എം.ടി', 'Alloy', 'അലോയ്', 2025, 800, 1035, 1340, 165, 795, 148, 12, 'Disc', 'ഡിസ്ക്', 'Disc', 'ഡിസ്ക്', '100/8017M/C 52P', '140/60R17M/C 63P', 'Telescopic', 'ടെലിസ്കോപ്പിക്', 'Swing Arm', 'സ്വിംഗ് ആം', 'Maintenance–free 12V, 3Ah', 'മെയിന്റനൻസ്-ഫ്രീ 12V, 3Ah', 'LED', 'LED', '20220221105612.pdf', NULL, '2022-02-21 10:56:12', '2022-02-21 10:56:12'),
