(17, 19, 'Presenting the upgraded Version of Burgman Street, The Special One which is Now, Even more Special.', 'ബർഗ്‌മാൻ സ്ട്രീറ്റിന്റെ അപ്‌ഗ്രേഡ് ചെയ്‌ത പതിപ്പ് അവതരിപ്പിക്കുന്നു, അത് ഇപ്പോൾ കൂടുതൽ വിശേഷപ്പെട്ടതാണ്.', '1725376290487932.png', 'Dual Tone Seat Color, Dual Tone Inner Leg Shield, Side Stand Interlock, Bluetooth Enabled Digital Console, Engine Start and Kill Switch with Suzuki Easy Start System, USB Socket, Front Disc Brake, Luxurious LED Headlights and Position Lights, LED Rear Combination Light, Standard Body Mounted Windscreen, Sporty Muffler Cover, Flexible Foot Position for Rider, 21.5 L Under Seat Storage, 2L Glove Box & Front Rack for Storage, Convenient Dual Luggage Hooks, Shutter Key with Central Seat Lock, Aluminium Pillion Footrest', 'ഡ്യുവൽ ടോൺ സീറ്റ് കളർ, ഡ്യുവൽ ടോൺ ഇന്നർ ലെഗ് ഷീൽഡ്, സൈഡ് സ്റ്റാൻഡ് ഇന്റർലോക്ക്, ബ്ലൂടൂത്ത് പ്രവർത്തനക്ഷമമാക്കിയ ഡിജിറ്റൽ കൺസോൾ, സുസുക്കി ഈസി സ്റ്റാർട്ട് സിസ്റ്റം, യുഎസ്ബി സോക്കറ്റ്, ഫ്രണ്ട് ഡിസ്‌ക് ബ്രേക്ക്, ആഡംബര എൽഇഡി ഹെഡ്‌ലൈറ്റുകൾ, പൊസിഷൻ ലൈറ്റുകൾ, എൽഇഡി റിയർ ലൈറ്റുകൾ, എൽഇഡി റിയർ കോമ്പിനേഷൻ, ബ്ലൂടൂത്ത് പ്രവർത്തനക്ഷമമാക്കിയ ഡിജിറ്റൽ കൺസോൾ. സ്റ്റാൻഡേർഡ് ബോഡി മൗണ്ടഡ് വിൻഡ്‌സ്‌ക്രീൻ, സ്‌പോർട്ടി മഫ്‌ളർ കവർ, റൈഡറിനുള്ള ഫ്ലെക്‌സിബിൾ ഫൂട്ട് പൊസിഷൻ, 21.5 എൽ സീറ്റിനടിയിൽ സ്‌റ്റോറേജ്, 2 എൽ ഗ്ലോവ് ബോക്‌സ് & ഫ്രണ്ട് റാക്ക് സ്‌റ്റോറേജ്, സൗകര്യപ്രദമായ ഡ്യുവൽ ലഗേജ് ഹുക്കുകൾ, സെൻട്രൽ സീറ്റ് ലോക്കോടുകൂടിയ ഷട്ടർ കീ, അലുമിനിയം പില്ല്യൺ ഫൂട്ട്', 'Side Step, Accessory Bar, Floor Mat, Seat Cover', 'സൈഡ് സ്റ്റെപ്പ്, ആക്സസറി ബാർ, ഫ്ലോർ മാറ്റ്, സീറ്റ് കവർ', 124, '4-Stroke, 1-Cylinder, Air Cooled', '4-സ്ട്രോക്ക്, 1-സിലിണ്ടർ, എയർ കൂൾഡ്', 'Fuel Injection', 'ഫ്യൂവൽ ഇഞ്ചക്ഷൻ', 'SOHC, 2-Valve', 'SOHC, 2-വാൽവ്', '52.5 x 57.4 mm', '8.7 ps @ 6750 rpm', '10 Nm @ 5500 rpm', 'Kick & Electrical', 'കിക്ക് & ഇലക്ട്രിക്കൽ', 'CVT', 'സി.വി.ടി', 'Alloy', 'അലോയ്', 1880, 715, 1140, 1265, 160, 780, 110, 5, 'Disc', 'ഡിസ്ക്', 'Drum', 'ഡ്രം', '90/90-12-54J Tubeless', '9/100-10-53J Tubeless', 'Telescopic', 'ടെലിസ്കോപ്പിക്', 'Swing Arm', 'സ്വിംഗ് ആം', 'Maintena