(1, 'We provide maintenance for your Suzuki motorcycles in Pathanamthitta', 'പത്തനംതിട്ടയിലെ നിങ്ങളുടെ സുസുക്കി മോട്ടോർസൈക്കിളുകൾക്ക് ഞങ്ങൾ മെയിന്റനൻസ് നൽകുന്നു', '<div>We have a very customer-friendly Service station in Pathanamthitta. Our Technicians have been trained under Suzuki Motorcycles India Pvt. Ltd. Regular training is given to our Technicians for every new variant coming into the market. On an average about 2500 vehicles are serviced per month.</div><div>The availability of on time Spare parts from Suzuki Motorcycles helps in servicing our customers without much delay. Only Suzuki Genuine Spare parts are used while servicing our vehicles.&nbsp;</div><div>Water Servicing &amp; polishing is done with every service.</div><div>Advanced Diagnosis System is available.</div><div>We also have Pick Up facility for Break Down vehicles. Serviced vehicles are also delivered at Door Step. Customers are followed up for the coming services and Post Follow Up for serviced customers is also done.</div><div>As we follow the Uniform Dealer Management System for Documentation, we have the entire Service History of any Customer.&nbsp;</div><div>The extended warranty also helps the customer with continued warranty for a period of 5 years.</div>', '<div>പത്തനംതിട്ടയിൽ ഞങ്ങൾക്ക് വളരെ ഉപഭോക്തൃ സൗഹൃദ സർവീസ് സ്റ്റേഷൻ ഉണ്ട്. ഞങ്ങളുടെ സാങ്കേതിക വിദഗ്ധർ സുസുക്കി മോട്ടോർസൈക്കിൾസ് ഇന്ത്യ പ്രൈവറ്റ് ലിമിറ്റഡിന്റെ കീഴിൽ പരിശീലനം നേടിയവരാണ്. Ltd. വിപണിയിൽ വരുന്ന ഓരോ പുതിയ വേരിയന്റിനും ഞങ്ങളുടെ ടെക്നീഷ്യൻമാർക്ക് റെഗുലർ പരിശീലനം നൽകുന്നു. പ്രതിമാസം ശരാശരി 2500 വാഹനങ്ങൾ സർവീസ് നടത്തുന്നുണ്ട്.</div><div>സുസുക്കി മോട്ടോർസൈക്കിളിൽ നിന്നുള്ള സ്പെയർ പാർട്‌സുകളുടെ കൃത്യസമയത്ത് ലഭ്യത ഞങ്ങളുടെ ഉപഭോക്താക്കൾക്ക് അധികം താമസമില്ലാതെ സേവനം നൽകാൻ സഹായിക്കുന്നു. ഞങ്ങളുടെ വാഹനങ്ങൾ സർവീസ് ചെയ്യുമ്പോൾ സുസുക്കി യഥാർത്ഥ സ്പെയർ പാർട്സ് മാത്രമേ ഉപയോഗിക്കൂ.</div><div>എല്ലാ സേവനങ്ങളിലും വാട്ടർ സർവീസിംഗും പോളിഷിംഗും നടത്തുന്നു.</div><div>വിപുലമായ രോഗനിർണയ സംവിധാനം ലഭ്യമാണ്.</div><div>ബ്രേക്ക് ഡൗൺ വാഹനങ്ങൾക്ക് പിക്ക് അപ്പ് സൗകര്യവുമുണ്ട്. സർവീസ് ചെയ്ത വാഹനങ്ങളും ഡോർ സ്റ്റെപ്പിൽ എത്തിക്കുന്നു. വരാനിരിക്കുന്ന സേവനങ്ങൾക്കായി ഉപഭോക്താക്കളെ പിന്തുടരുകയും സേവനമുള്ള ഉപഭോക്താക്കൾക്കായി പോസ്റ്റ് ഫോളോ അപ്പ് നടത്തുകയും ചെയ്യുന്നു.</div><div>ഡോക്യുമെന്റേഷനായി ഞങ്ങൾ യൂണിഫോം ഡീലർ മാനേജ്മെന്റ് സിസ്റ്റം പിന്തുടരുമ്പോൾ, ഏതൊരു ഉപഭോക്താവിന്റെയും മുഴുവൻ സേവന ചരിത്രവും ഞങ്ങൾക്കുണ്ട്.</div><div>വിപുലീകൃത വാറന്റി ഉപഭോക്താവിനെ 5 വർഷത്തേക്ക് തുടർച്ചയായ വാറന്റിയിൽ സഹായിക്കുന്നു.</div>', '1725276613520728.jpg', '1725276614104777.jpg', '1725276614611465.jpg', '1725276615119203.jpg', '1725276615543682.jpg', '<h3><font color=\"#ce0000\" style=\"\"><b>CONTACTS</b></font></h3><h3><span style=\"font-size: 16px;\"><b>Service Manager (Anil)</b>: 9495043320</span></h3><h3><span style=\"font-size: 16px;\"><b>Advisor (Vishnu)</b>: 9349543370</span></h3><h3><span style=\"font-size: 16px;\"><b>Advisor (Vyshak)</b>: 9349543340</span></h3><h3><span style=\"font-size: 16px;\"><b>Reception</b>: 6238783773</span></h3><h3><span style=\"font-size: 16px;\"><b>Spare</b>: 9349543330</span></h3><h3><span style=\"font-size: 16px;\"><b>Email</b>: ptasuzuki.service@gmail.com</span></h3>', NULL, '2022-02-26 07:49:51');
